Hemos pasado la chipitarde en la Playa de La Griega jijij. Esta un poquito aisladita pero mereca la penita ir allí, primero por lo chipiprecioso que es el paisaje y segundonporque hay restos de icnitas, es decir huellad de dinosaurios. Hace chipicientos años, casi 200 millones de años, esta zona era una marisma donde paseaban los dinosaurios, sacaban a sus babys a jugar e iban al Mercadona, como hacemos nosotros ahora. Y han dejado huella jiji...a unos escasitos metritos del mar se ven unas enormes pisadas de dinosaurios, que mieditos. Nos sentimos unos chipiapleontólogos intentando adivinar a quien pertenecían. Las que tienen dos partes, como si fueran de un zapato de tacón corresponden a herbivoros cuadrupedos como los tireóforos y los de tres deditos a ornitopodos, dinosaurios veganos y bipedos jiji. Mis besties Amorfo y Moni se sentían muy peques al ver el tamaño de estas chipihuellas, pero yo no, porque soy un gran Kraken!!!! 

